      <p><b>2244 Tesla</b>, provisional designation 1952 UW, is a carbonaceous <a href=""https://en.wikipedia.org/wiki/Asteroid"" title=""Asteroid"">asteroid</a> from the central region of the <a href=""https://en.wikipedia.org/wiki/Asteroid_belt"">asteroid belt</a>, approximately 25 kilometers in diameter. It was discovered on 22 October ");
