      <h2 id=""Orbit"">Orbit</h2>
      <hr />
      <p><i>Tesla</i> orbits the Sun in ");
                WriteLiteral(@"the central main-belt at a distance of 2.3–3.3 AU once every 4 years and 9 months (1,721 days). Its orbit has an eccentricity of 0.18 and an inclination of 8° with respect to the ecliptic. It was first identified as 1938 UE1 at Turku Observatory in 1938, extending the body's observation arc by 14 years prior to its official discovery at Belgrade.</p>
      <h2 id=""Physical_characteristics"">Physical characteristics</h2>
      <hr />
      <p>In the SMASS taxonomy, Tesla is a dark C-type asteroid. According to the survey carried out by NASA's Wide-field Infrared Survey Explorer with its subsequent NEOWISE mission, <i>Tesla</i> measures 24.37 kilometers in diameter and its surface has a low albedo of 0.050, in correspondence with its carbonaceous composition. A larger diameter estimate of 29 kilometers was obtained in 2008, from an asteroid occultation.</p>
      <h3 id=""Lightcurves"">Lightcurves</h3>
